Here is a basic example of a Rust application that uses the elevenlabs.io API to read the contents of the clipboard aloud using text-to-speech (TTS):

**Cargo.toml**
```toml
[package]
name = "elevenlabs_tts"
version = "0.1.0"
edition = "2018"

[dependencies]
reqwest = "0.11.4"
tokio = { version = "1", features = ["full"] }
clipboard = "0.5.0"
tts = "0.1.0"
```

**src/main.rs**
```rust
use reqwest;
use tokio;
use clipboard;
use tts;

#[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> {
    // Set up elevenlabs.io API credentials
    let api_key = "YOUR_API_KEY_HERE";
    let api_secret = "YOUR_API_SECRET_HERE";

    // Set up TTS engine
    let tts_engine = tts::Engine::new("espeak");

    // Get clipboard contents
    let clipboard_contents = clipboard::get_clipboard_contents().await?;

    // Create API request to elevenlabs.io
    let client = reqwest::Client::new();
    let response = client.post("https://api.elevenlabs.io/v1/tts")
        .header("Authorization", format!("Bearer {}", api_key))
        .header("Content-Type", "application/json")
        .body(format!("{{ \"text\": \"{}\" }}", clipboard_contents))
        .send().await?;

    // Check if response was successful
    if response.status().is_success() {
        // Get audio data from response
        let audio_data = response.bytes().await?;

        // Play audio using TTS engine
        tts_engine.play(audio_data).await?;
    } else {
        eprintln!("Error: {}", response.status());
    }

    Ok(())
}
```

**Note:**

* You'll need to replace `YOUR_API_KEY_HERE` and `YOUR_API_SECRET_HERE` with your actual elevenlabs.io API credentials.
* This example uses the `espeak` TTS engine, but you can use any other engine supported by the `tts` crate.
* This example assumes that the clipboard contents are text, but you may want to add error handling for other types of clipboard data.

**Build and run:**

1. Install the required dependencies by running `cargo build` in the terminal.
2. Run the application by executing `cargo run` in the terminal.

