Here is the step by step guide to create a React, Node, and Express.js web app for creating and displaying dummy data, and deploying it:

**Step 1: Create a new React app**

Open your terminal and run the following command to create a new React app:
```
npx create-react-app my-app
```
This will create a new React app in a directory called `my-app`.

**Step 2: Create a new Node and Express.js server**

In the same terminal, navigate to the `my-app` directory and run the following command to create a new Node and Express.js server:
```
npm init -y
npm install express
```
This will create a new `package.json` file and install Express.js.

**Step 3: Create a new file for the server**

Create a new file called `server.js` in the `my-app` directory and add the following code:
```
const express = require('express');
const app = express();
const port = 3001;

app.use(express.json());

let dummyData = [
  { id: 1, name: 'John Doe', age: 30 },
  { id: 2, name: 'Jane Doe', age: 25 },
  { id: 3, name: 'Bob Smith', age: 40 },
];

app.get('/api/data', (req, res) => {
  res.json(dummyData);
});

app.post('/api/data', (req, res) => {
  const newData = req.body;
  dummyData.push(newData);
  res.json(dummyData);
});

app.listen(port, () => {
  console.log(`Server started on port ${port}`);
});
```
This code sets up an Express.js server that listens on port 3001 and has two endpoints: one to retrieve the dummy data and one to add new data.

**Step 4: Create a new React component to display the data**

Create a new file called `DataList.js` in the `my-app/src` directory and add the following code:
```
import React, { useState, useEffect } from 'react';

function DataList() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3001/api/data')
      .then(response => response.json())
      .then(data => setData(data));
  }, []);

  return (
    <div>
      <h1>Data List</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>
            <span>{item.name}</span>
            <span>{item.age}</span>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default DataList;
```
This code creates a new React component that fetches the dummy data from the server and displays it in a list.

**Step 5: Add the React component to the app**

Open the `my-app/src/App.js` file and add the following code:
```
import React from 'react';
import DataList from './DataList';

function App() {
  return (
    <div>
      <DataList />
    </div>
  );
}

export default App;
```
This code adds the `DataList` component to the app.

**Step 6: Start the server and the app**

Open two terminals and navigate to the `my-app` directory. In one terminal, run the following command to start the server:
```
node server.js
```
In the other terminal, run the following command to start the app:
```
npm start
``
